[code]import java.net.URL;

import org.apache.bcel.classfile.Method;
import org.apache.bcel.generic.ClassGen;

public class Update {
	public static void getLocationX() throws Exception {
		JarHandler jarH = new JarHandler(new URL(
				"http://world19.runescape.com/runescape.jar"));
		ClassGen[] cgen = jarH.getClasses();
		for (int a = 0; a != cgen.length; a++) {
			Method[] meths = cgen[a].getMethods();
			for (int b = 0; b != meths.length; b++) {
				if (meths[b].getName() == "getLocationX()") {
					System.out.println("Found getLocationX() AT "
							+ cgen[a].getClassName());
					break;
				}
			}
			break;
		}
	}
